import {Link} from "react-router-dom";
import Button from "react-bootstrap/Button";
import {Row} from "react-bootstrap";
import Col from "react-bootstrap/Col";

function PerNavScreen() {
    return (
        <div >
            <Col>
                <Row style={{ display:"flex",justifyContent:"center",alignItems:"center"}}>
                <button type="button" className="btn btn-success" style={{display:"flex",justifyContent:"center",flex:1}}>İZİN TALEBİ YARAT</button>
                <button type="button" className="btn btn-success" style={{display:"flex",flex:1,justifyContent:"center"}}>GEÇMİŞ İZİNLERİ GÖRÜNTÜLE</button>
                </Row>
            </Col>
        </div>
    );
}

export default PerNavScreen;
